    protected override Humidifier.GroundStation.ConfigTypes.AntennaDownlinkDemodDecodeConfig Create()
    {
        var antennaDownlinkDemodDecodeConfigResult = CreateAntennaDownlinkDemodDecodeConfig();
        factoryAction?.Invoke(antennaDownlinkDemodDecodeConfigResult);

