    }

    private Humidifier.GroundStation.ConfigTypes.AntennaDownlinkDemodDecodeConfig CreateAntennaDownlinkDemodDecodeConfig()
    {
        var antennaDownlinkDemodDecodeConfigResult = new Humidifier.GroundStation.ConfigTypes.AntennaDownlinkDemodDecodeConfig();

        return antennaDownlinkDemodDecodeConfigResult;
    }
    public override void CreateChildren(Humidifier.GroundStation.ConfigTypes.AntennaDownlinkDemodDecodeConfig result)
    {
        base.CreateChildren(result);

        result.DemodulationConfig ??= DemodulationConfigFactory?.Build();
        result.SpectrumConfig ??= SpectrumConfigFactory?.Build();
        result.DecodeConfig ??= DecodeConfigFactory?.Build();
    }

